  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'quest';

  constructor(private _dataReceiverService: DataReceiverService) { }
}
<div class="container">
  <app-workers-list class="workers-list"></app-workers-list>
  <app-flights-table class="flights-table"></app-flights-table>
  <app-flight-information class="flight-information"></app-flight-information>
</div>
